import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './components/HomePage';
import Dashboard from './components/Dashboard';
import BooksPage from './components/BooksPage';
import GenresPage from './components/GenresPage';
import BookDetailsPage from './components/BookDetailsPage';
import AddBookForm from './components/AddBookForm';
import EditBookForm from './components/EditBookForm';
import AuthorsPage from './components/AuthorsPage';
import AuthorDetailsPage from './components/AuthorDetailsPage';
import AddAuthorForm from './components/AddAuthorForm';
import EditAuthorForm from './components/EditAuthorForm';
import ShowBook from './components/showbook';
import Delete from './components/deletebook';
import Issuebook from './components/Issuebook';
import Returnbook from './components/Returnbook';
import AdminLoginForm from './components/AdminLoginForm';
import UserLogin from './components/UserLogin';
import ManageMembers from './components/ManageMembers'; 
import './App.css';
import './components/styles.css';

function App() {
  return (
    <div className="App">
      <main>
        <Router>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/admin/login" element={<AdminLoginForm />} /> {/* Updated path to match AdminLoginForm */}
            <Route path="/user/login" element={<UserLogin />} /> {/* Assuming UserLogin component exists */}
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/books" element={<BooksPage />} />
            <Route path="/genres" element={<GenresPage />} /> {/* Corrected path to match GenresPage */}
            <Route path="/books/add" element={<AddBookForm />} />
            <Route path="/books/:book_id" element={<BookDetailsPage />} />
            <Route path="/books/edit/:book_id" element={<EditBookForm />} /> {/* Corrected path to match EditBookForm */}
            <Route path="/books/show" element={<ShowBook />} />
            <Route path="/books/issue" element={<Issuebook />} /> {/* Corrected path to match Issuebook */}
            <Route path="/books/return" element={<Returnbook />} /> {/* Corrected path to match Returnbook */}
            <Route path="/books/delete" element={<Delete />} />
            <Route path="/authors" element={<AuthorsPage />} />
            <Route path="/authors/add" element={<AddAuthorForm />} />
            <Route path="/authors/:author_id" element={<AuthorDetailsPage />} />
            <Route path="/authors/edit/:author_id" element={<EditAuthorForm />} />
            <Route path="/members" element={<ManageMembers />} /> {/* Route for managing members */}
          </Routes>
        </Router>
      </main>
    </div>
  );
}

export default App;
